//https://leetcode.com/problems/group-anagrams/
struct Solution;
use std::collections::HashMap;

impl Solution {
    pub fn group_anagrams(strs: Vec<String>) -> Vec<Vec<String>> {
        let mut anagram_groups: HashMap<String, Vec<String>> = HashMap::new();
        for s in strs {
            let mut ss: Vec<char> = s.chars().collect();
            /*//Not yet!
            let mut hash = vec![0; 26];
            for &c in ss.iter() {
                hash[ c as usize - 97 ] += 1;
            }
            */
            ss.sort();
            let ss = String::from_iter(ss);
            anagram_groups
                .entry(ss)
                .and_modify(|e| e.push(s.clone()))
                .or_insert(vec![s]);
        }
        anagram_groups.into_values().collect::<Vec<Vec<String>>>()
    }
}
fn main() {
    println!("Hello, world!");
}

