    #[test]
    fn test_group_anagrams() {
        for (strs, mut want) in testcases() {
            for i in 0..want.len() {
                want[i].sort();
            }
            want.sort();
            let mut got = Solution::group_anagrams(strs);
            for i in 0..got.len() {
                got[i].sort();
            }
            got.sort();
            assert_eq!(got, want);
        }
    }
